import styled from "styled-components";

export const Logo = styled.div`
	.logo-container {
		display: flex;
		flex-direction: column;
		align-items: center;
	}
	.logo-image {
		height: 100px;
		width: auto;
	}
	.logo-name {
		height: auto;
		width: 100px;
	}
`;
